import { useEffect } from "react";
import { useState } from "react";



function EmpList() {
    const [empdata, setEmpdata] = useState("")
    useEffect(() => {
        fetch("http://localhost:3007/Employe")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                setEmpdata(resp)
            })
    })
    return (
        <div className="container">
            <div className="card">
                <div className="card-title">
                    <h3>Employe Management system</h3>
                </div>
                <div className="card-body">
                    <table className="table table-bordered">
                        <thead className="text-white bg-dark">
                            <tr>
                                <th>ID</th>
                                <th>Name</th>
                                <th>Email</th>
                                <th>PhoneNo</th>
                            </tr>
                        </thead>
                        <tbody>
                        {empdata.map(item => (
                          
                                <tr>
                                    <td>{item.id}</td>
                                    <td>{item.name}</td>
                                    <td>{item.email}</td>
                                    <td>{item.phone}</td>
                                </tr>
                            
                        ))
                        }
                        </tbody>


                    </table>
                </div>
            </div>
        </div>
    )
}

export default EmpList;
